function configupdateform(){var a={"id":$("#Id_update").val(),"configName":$("#configName_update").val(),"configKey":$("#configKey_update").val(),"configValue":$("#configValue_update").val(),"description":$("#description_update").val()};console.log(a);if(a.configName==""){$.messager.alert("提示","配置项名称不能为空");return}if(a.configKey==""){$.messager.alert("提示","配置项代码不能为空");return}if(a.configValue==""){$.messager.alert("提示","配置项值不能为空");return}$.ajax({url:ws_url+"/rest/Sysconfig/updateConfig?token="+gtoken,contentType:"application/json;charset=UTF-8",type:"post",datatype:"json",data:JSON.stringify(a),cache:false,success:function(b){console.log(b.status);console.log(b.message);$("#form2").form("clear");if(b.status=="success"){$.messager.alert("提示","修改成功！","info",function(){$("#configupdate").window("close");$("#configgrid").datagrid("clearSelections");$("#configgrid").datagrid("reload")})}else{if(b.status=="failure"){$.messager.alert("提示","修改失败！","error",function(){$("#configupdate").window("close");$("#configgrid").datagrid("clearSelections");$("#configgrid").datagrid("reload")})}}},error:function(b){console.log(b)}})};